import React from "react";
import { ResenjeContainer, ResenjeTitle } from "./ResenjeElements";
import { DiReact } from "react-icons/di";
import { SiSpring } from "react-icons/si";

function Resenje() {
  return (
    <>
      <ResenjeContainer id="resenje">
        <ResenjeTitle>
          Front End: <DiReact />
          React
        </ResenjeTitle>
        <ResenjeTitle>
          ML: <DiReact />
        </ResenjeTitle>
        <ResenjeTitle>
          Back End: <SiSpring />
          Spring Framework
        </ResenjeTitle>
      </ResenjeContainer>
    </>
  );
}

export default Resenje;
